import React, { useState } from 'react';
import './App.css';
import Form from './Form';
import Item from './Item';

function App() { 

  const [items, setItem] = useState(["Eat", "Sleep", "Feri Eat"]);

  return (
    <div className="app">
       <Form />
       {
         items.map(item => {
           <Item title={item} />
         })
       }
    </div>
  );  
}

export default App;
